script: |
  super -f text -I q2366.spq | sort > q2366.out

inputs:
  - name: q2366.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN - - col0 * + col1 AND 23 * col0 * - col0 + - ( + 58 ) * - col0 / + 86;
  - name: tab2

outputs:
  - name: q2366.out
    data: |
      46	51	23
      64	77	40
      75	67	58
